import React, {useState, useEffect} from 'react'
import {Link} from 'react-router-dom'
import axios from "axios";
import CoursesIT from "./coursesIT";

function Posts({match}) {

  const [event, setData] = useState([]);

  useEffect(() => {
    axios({
      method: "GET",
      url: `http://127.0.0.1:8000/api/mer/`
    }).then(response => {
      setData(response.data)
    })
  });
  {
    return (
        <section className="section">
          <div className="container">
            <div className="row mb-5">
              <div className="col-12">
                <div className="btn-group btn-group-toggle justify-content-center d-flex" data-toggle="buttons">
                  <Link to={{pathname: '/posts-list1', fromDashboard: false}}>
                    <label className="btn btn-sm btn-primary">
                      <input type="radio" name="shuffle-filter" value="design"
                             style={{position: 'absolute', clip: 'rect(0,0,0,0)', pointerEvents: 'none'}}/>Програмиирование
                    </label>
                  </Link>
                  <Link to={{pathname: '/posts-list2', fromDashboard: false}}>
                    <label className="btn btn-sm btn-primary">
                      <input type="radio" name="shuffle-filter" value="design"
                             style={{position: 'absolute', clip: 'rect(0,0,0,0)', pointerEvents: 'none'}}/>Мероприятия для
                      педагогов
                    </label>
                  </Link>
                  <Link to={{pathname: '/posts-list3', fromDashboard: false}}>
                    <label className="btn btn-sm btn-primary">
                      <input type="radio" name="shuffle-filter" value="design"
                             style={{position: 'absolute', clip: 'rect(0,0,0,0)', pointerEvents: 'none'}}/>Мероприятия для
                      препринимателей
                    </label>
                  </Link>
                </div>
              </div>
            </div>
            <div className="row shuffle-wrapper">
              <CoursesIT/>
              <CoursesIT/>
              <CoursesIT/>
            </div>
          </div>
        </section>

    )
  }
}


export default Posts;
